                   aura_env.texttimers[i] = C_Timer.NewTimer(aura_env.dispeltimes[i]-1-aura_env.alerttime, function()\
                           WeakAuras.ScanEvents(\"NS_DISPEL_EVENT\", aura_env.id)    \
                   end)\
               end\
           end\
       elseif aura_env.found and not NSAPI.disable then     \
           if e == \"NS_ASSIGN_EVENT\" then        \
               local id, unit, G, glow = ...\
               if id == aura_env.id then\
                   local now = GetTime()                   \
                   local state = {\
                       progressType = \"timed\",\
                       duration = 600,\
                       expirationTime = 600+now,\
                       glow = false,\
                       ignorepos = true,\
                       assigned = true,\
                       unit = unit,\
                       autoHide = true,\
                   }\
                   s:Update(G, state)\
               end  \
           elseif e == \"NS_BACKUP_GLOW\" then        \
               local id, unit, G, glow = ...\
               if id == aura_env.id and UnitGroupRolesAssigned(\"player\") == \"HEALER\" and aura_env.mygroup == 0 then -- assign all non-assigned healers to a backup holder                \
                   local now = GetTime()                   \
                   local state = {\
                       progressType = \"timed\",\
                       duration = 600,\
                       expirationTime = 600+now,\
                       glow = false,\
                       ignorepos = true,\
                       assigned = true,\
                       unit = unit,\
                       autoHide = true,\
                   }\
                   s:Update(G, state)\
               end        \
           elseif e == \"NS_DISPEL_GLOW\" and ... and ... == aura_env.id then\
