               if UnitIsUnit(units[i][1], \"player\") then\
                   aura_env.me = 1\
                   WeakAuras.ScanEvents(\"NS_ASSIGN_CHECK_DISPLAY\", \"NS_MANAFORGE\", {}, true, \"nshuntstart\", \"\", 1)\
               end\
