           for i=(onethird*2)+1, #units do\
               table.insert(aura_env.list[3], units[i][1])\
               if UnitIsUnit(units[i][1], \"player\") then\
                   aura_env.me = 3\
                   WeakAuras.ScanEvents(\"NS_ASSIGN_CHECK_DISPLAY\", \"NS_MANAFORGE\", {}, true, \"nshuntstart\", \"\", 3)\
